description:
Responsible for data analysis and modeling of user growth and user research;

Find growth opportunities through data analysis, improve user scale, activity, business value and user experience, including but not limited to user acquisition, promotion, recall, refine operations for different user groups, improve the conversion rate of link funnels, and improve Operational ROI and car owner/user... satisfaction;

Identify key projects and digitization stages in the business domain, judge data-enabled business opportunities,

Proficiency in using at least one data analysis tool such as SQL, Python, R;

Have strong thinking logic ability, good data sensitivity, good at communication

The Research Associate II will lead data preparation and quantitative data analysis for research and evaluation projects for clients such as the Centers for Medicare and Medicaid Services (CMS) and the Health Resources Services Administration (HRSA). In this capacity, the RAII will develop, design, and conduct analyses for various projects that examine the impact of health care interventions... These tasks include data cleaning and manipulating large, complex datasets, data management, statistical analysis, and developing reports and presentations tailored to a variety of audiences. The RAII will work collaboratively with teams to define research and evaluation questions, evaluate the strengths and limitations of potential data sources, and specify appropriate analyses necessary to answer questions. The RAII will actively cultivate long-term relationships with existing clients and partners and will also seek out potential new relationships by managing projects with excellence and providing consistently excellent customer service. The RAII will engage in a process of continuous commitment to excellent client relations, as focus on these relationships is one of the primary strategic roles of the position across all areas of his/her/their work. The RAII will be responsible for collaborating with senior staff and model an excellent approach to teamwork.
â€¢ **** Please note: Applicants will need to pass a drug screening and client background check. You must have lived 3 of the last 5 years in the United States. *****

ESSENTIAL JOB FUNCTIONS:

Research and Evaluation Activities
â€¢ Lead analytic activities for evaluation research studies which may include but not limited to studies on public health and behavioral health;
â€¢ Contribute to complex research and evaluation studies and designs including multi-site surveys, randomized controlled trials, and quasi experimental studies;
â€¢ Provide analytical expertise in inferential statistics, multivariate statistics, and multilevel statistical modeling;
â€¢ Provide expertise for robust statistical analyses (e.g., Time Series, Growth Curve Models, Propensity Score Matching, Regression Discontinuity, Difference-in-Differences);
â€¢ Conduct data analysis in collaboration with other staff or alone; apply sufficient knowledge of statistical procedures and statistical programming to work independently on statistical analysis;
â€¢ Lead data interpretation, report preparation, and publications;
â€¢ Lead research and evaluation designs in collaboration with other team members;
â€¢ Leads conversion of data outputs to charts, tables, infographics, and text for use in presentations and reports
â€¢ Develops issue briefs, case studies, white papers and other materials to convey study findings, best practices, and recommendations to a wide audience

Data Management and Data Collection
â€¢ Provide expertise in managing large complex secondary data sources including Federal and State health care claims and other administrative data sources;
â€¢ Support and lead primary data collection efforts;
â€¢ Develop and monitor data collection plans;
â€¢ Develop data collection training materials and training protocols.

Business Development Support
â€¢ Develop plans and proposals in response to federal contract requests;
â€¢ Use specialized knowledge of a region or area of expertise to assist senior staff in investigating and developing new business opportunities through review of potential proposal requests, networking with other research organizations, contacting and recruiting subject matter experts in the areas of interest.

Logistical and Administrative Tasks
â€¢ Manage projects or lead key tasks, as directed;
â€¢ Manage and help manage workshops for clients, as needed;
â€¢ Handle job tasks with minimal supervision, completing them in an accurate and timely manner.

MINIMUM JOB QUALIFICATIONS:

Language: English Fluency

Education: Masterâ€™s or bachelorâ€™s degree in public health-related field (e.g., Sociology, Statistics, Education, Economics, Social Sciences, Community Psychology) with coursework in statistics.

Knowledge: Knowledge of research and evaluation design and statistical analysis techniques. Understanding of Medicare fee-for-service program and its claims data.

Soft Skills: Ability to communicate effectively, ability to work independently or work collaboratively with a team. Ability to work in fast paced environment with multiple deadlines. Must demonstrate initiative.

Experience: For applicants with a masterâ€™s degree five years of experience, including 3 years of focused experience conducting surveys, quantitative research and evaluation using claims data is required. For applicants with a bachelorâ€™s degree 8 years of experience is required.

Software Proficiency: Experience conducting data management and analyses in SAS and SQL are preferred. Experience in other languages such as Stata or R may be sufficient. Proficiency in MS Excel, MS Word, MS Access, MS PowerPoint, and Alchemer (or other online survey tools).

Location: San Mateo, California; North Bethesda, Maryland; or Remote.

PREFERRED JOB QUALIFICATIONS:

Education: Ph.D. with two years of experience.

Software Proficiency: Advanced experience with database development and management using MS Access or other tools and/or familiarity with SQL or SQLPlus and dynamic data visualization tools (e.g., Power BI, Tableau).

Experience: Expertise with process mapping and principal component analysis.

OTHER DUTIES AS ASSIGNED: This position description should not be construed to imply that these requirements are the exclusive standards of the position, nor will it be the sole basis for any subsequent employee evaluations. Incumbents will follow any other instructions and perform any other related duties as may be required by their supervisor.

This position is subject to availability of funds and to any and all restrictions contained in the contract or contracts that provide funding for this position

APPLICATION INFORMATION:

If you meet the minimum requirements for this position, please click on the "Apply" link posted below and complete the application. Please include a cover letter, resume, and at least three (3) professional references.

Our company is an equal opportunity/affirmative action employer. Applicants can learn more about the company's status as an equal opportunity employer by viewing the federal "EEO is the Law" poster at EEOPost.pdf.

Qualified applicants will receive consideration for employment without regard to race, color, religion, sex, gender identity, sexual orientation, national origin, disability, or protected Veteran status

Project Description

Working in a team that is responsible to set up operations in new countries...

Around 5 years of Industry experience working in a corporate environment, working with multi-disciplinary environment. Should have exposure to manage operations and work in multi-location, virtual teams setup.

Responsibilities
â€¢ Search, consolidate and analyze information about the external and internal environment of the Company, information on global, national, market trends, development of new technologies, risk factors, analyzes factors that may affect business development;
â€¢ Provides management with up-to-date information on global and local trends, and other information that has a potential impact on the formation and implementation of corporate strategy and functional strategies;
â€¢ Conducts qualitative and quantitative market research and summarize key findings in form of charts and presentations;
â€¢ Participates in strategy development and / or strategic management decisions, analyze competitors and clients to provide data-driven recommendations;
â€¢ Plays a key role in the formulation of hypotheses, interpretation of data, and development of recommendations within project work;
â€¢ Develops, ensures the approval and updating of the methodology of strategic analysis; identifies, aggregates and analyzes data to communicate market trends and opportunities;
â€¢ Provides preparation and regular updating of the annual analytical reports and presentations for updating of strategic documents;
â€¢ Performs other strategic research at the request of the company's management;
â€¢ Creates detailed business analysis, outlining problems, opportunities and solutions for a business;
â€¢ Improve systems by studying current practices, suggest designing modifications;
â€¢ Recommends controls by identifying problems and writes improved procedures, delivering the project on time, in the expected quality;
â€¢ Plans the strategy and approach on how to conduct the requirements analysis to ensure the scope is well defined and expectations are set with the stakeholders;
â€¢ Responsible for all necessary planning, controlling and reporting tasks within its project, providing the stakeholders with transparent, accurate and regular information regarding the status of committed project deliveries
â€¢ Complies with given standards and regulations, managing risks, issues and dependencies;
â€¢ Contributes to a positive team spirit,

Skills

Must have
â€¢ Experienced in working in a Consulting company (Strategic consulting) or a Corporate Strategic Analysis department of a multinational company, providing recommendations to C-suite executives for at least 2 years.
â€¢ Development/Software Engineering background is not required.

Nice to have

Risk analysis, dependencies, and decision analysis skills

Salary

Depending on the profile

